nd machine learning professionals. Many of you are making one last push to learn new skills, catch up with recent research, or prepare for your next career move before the holiday season \\u003cem style\\u003d\\\"font-style:italic\\\"\\u003ereally \\u003c/em\\u003ekicks in in many parts of the world.\\u003c/p\\u003e\\u003cp style\\u003d\\\"margin:0;font-weight:400;margin-top:0.8em;font-size:1em;line-height:1.5\\\"\\u003eOur selection of must-reads from November covers a great deal of ground and echoes the topics and interests our community has focused on in recent weeksfrom working with knowledge graphs to streamlining the job-search process. We hope you explore these excellent articles as you make plans for the new year just around the corner. Enjoy!\\u003c/p\\u003e\\u003ch3 style\\u003d\\\"margin:0;font-weight:500;margin-left:0px;margin-right:0px;margin-top:1em;margin-bottom:0.5em;font-size:1.17em;line-height:1.25;letter-spacing:-0.02em\\\"\\u003ePopular posts\\u003c/h3\\u003e\\u003cp style\\u003d\\\"margin:0;font-weight:400;margin-top:0.8em;font-size:1em;line-height:1.5\\\"\\u003eIn case you missed them, here are some of our most-read and -shared posts from the past month.\\u003c/p\\u003e\\u003cul style\\u003d\\\"margin-top:1em;margin-right:0px;margin-bottom:0px;margin-left:1.5em;display:block;padding:0px\\\"\\u003e\\u003cli style\\u003d\\\"margin-left:1em;font-size:1em;line-height:1.5;letter-spacing:-0.15%;color:#282828\\\"\\u003e\\u003cp style\\u003d\\\"margin:0;font-weight:400;margin-top:0.8em;font-size:1em;line-height:1.5\\\"\\u003e\\u003ca href\\u003d\\\"https://towardsdatascience.com/how-to-convert-any-text-into-a-graph-of-concepts-110844f22a1a\\\" rel\\u003d\\\"nofollow noopener\\\" style\\u003d\\\"text-decoration:none;display:inline;font-weight:600;color:#0a66c2;text-decoration-line:none\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://towardsdatascience.com/how-to-convert-any-text-into-a-graph-of-concepts-110844f22a1a\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1701459548995000\\u0026amp;usg\\u003dAOvVaw2wKvrTdC8FEWUltGabKA4b\\\"\\u003e\\u003cstrong\\u003eHow to Convert Any Text Into a Graph of Concepts.\\u003c/strong\\u003e\\u003c/a\\u003e\\u003cstrong\\u003e \\u003c/strong\\u003eLearn how you can transform any text corpus into a knowledge graph using the Mistral 7B model: \\u003ca href\\u003d\\\"https://www.linkedin.com/in/rahulnyk?miniProfileUrn\\u003durn%3Ali%3Afs_miniProfile%3AACoAAAKr-coBCPxCh1EsMqePXek64bq0j-kVyps\\\" style\\u003d\\\"text-decoration:none;display:inline;font-weight:600;color:#0a66c2;text-decoration-line:none\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.linkedin.com/in/rahulnyk?miniProfileUrn%3Durn%253Ali%253Afs_miniProfile%253AACoAAAKr-coBCPxCh1EsMqePXek64bq0j-kVyps\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1701459548995000\\u0026amp;usg\\u003dAOvVaw1tXU4LXJ3D9l4hbpHoG3AQ\\\"\\u003eRahul Nayak\\u003c/a\\u003es well-illustrated (and massively successful) guide covers the entire process in detail.\\u003c/p\\u003e\\u003c/li\\u003e\\u003cli style\\u003d\\\"margin-left:1em;font-size:1em;line-height:1.5;letter-spacing:-0.15%;color:#282828\\\"\\u003e\\u003cp style\\u003d\\\"margin:0;font-weight:400;margin-top:0.8em;font-size:1em;line-height:1.5\\\"\\u003e\\u003ca href\\u003d\\\"https://towardsdatascience.com/apple-m2-max-gpu-vs-nvidia-v100-p100-and-t4-8b0d18d08894\\\" rel\\u003d\\\"nofollow noopener\\\" style\\u003d\\\"text-decoration:none;display:inline;font-weight:600;color:#0a66c2;text-decoration-line:none\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://towardsdatascience.com/apple-m2-max-gpu-vs-nvidia-v100-p100-and-t4-8b0d18d08894\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1701459548995000\\u0026amp;usg\\u003dAOvVaw24_388NUHnhHm6gcuUqWOr\\\"\\u003e\\u003cstrong\\u003eApple M2 Max GPU vs Nvidia V100, P
